class App extends React.Component {
  render() {
    return (
      <div className="demo-big-content">
        <Layout>
            <Header title="Home" scroll>
                <Navigation>
                    <Link to="/APUSupport">APU Support Chat</Link>
                    <Link to="/WEPASupport">WEPA Support Chat</Link>
                </Navigation>
            </Header>
            <Content>
                <div className="page-content" />
                <Main/>
            </Content>
        </Layout>
    </div>
      // <div className="App">
